(
A
) Duplex sonography of the right neck region obtained on the first day of life showing the vertebral artery and multiple hypoechogenic cysts of different size representing a mixed-type lymphangioma. (
B
) Magnetic resonance imaging scan of the neck region showing multiple cysts of different size extending from the skull base to the upper thoracic aperture in the anterior region of the neck.

Photograph taken at 16 months. (
A
) Straight hair on the right side of her head which is affected by Horner's syndrome. (
B
) The original hair texture of the infant is retained on the left side of the head which is not affected by Horner's syndrome.
